import React from "react";
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Outlet,
    NavLink,
    useParams,
    useSearchParams,
    Navigate,
    useNavigate,
    Link,
  } from 'react-router-dom';
import "./App.css";
const setActive = ({ isActive }) => (isActive ? 'active' : '');
function NavMenu() {
    return (
      <div className="navMenu">
        <NavLink to="/" className={setActive}>
          Home
        </NavLink>
        <NavLink to="/famous_landmark" className={setActive}>
            famous landmark
        </NavLink>
        <NavLink to="photos_of_the_city">

        </NavLink>

      </div>
    );
  }
  function Home() {
      return (
          <div className="home">
              <h1>Home</h1>
          </div>
      );
  }
    function FamousLandmark() {
        return (
            <div className="famousLandmark">
                <h1>famous landmark</h1>
            </div>
        );
    }

  export default function MyCity() {
    return (
        <div className = "App">
            <Router>
                <NavMenu />
                <Routes>
                    <Route path="/" exact element={<Home/>} />
                    <Route path="/famous_landmark" element={<FamousLandmark/>} />
                </Routes>
            </Router>
        </div>         
    );
} 


